function ImagePopup({card, isOpen, onClose}) {
    return (
        <div className={`popup popup-full-image ${card && isOpen ? 'popup_visible' : ''}`}>
        <figure className="popup__container-full-image">
          <img className="popup__pic" src = {card ? card.link : ''}
                            alt= {card ? card.alt : ''} />
          <figcaption className="popup__pic-directory">{card ? card.name : ''}</figcaption>
          <button type="button" title="button" className="popup__close popup__close_photo" aria-label="close" onClick={onClose}></button>
        </figure>
      </div>

    );
}

export default ImagePopup;
